import React, {Component} from 'react';
import "./Node.css";

function Node(props){
    const extraclassName= props.isEnd? 'node-end': props.isStart? 'node-start': props.isWall?'node-wall':'';
    return <div 
        id={`${props.row}-${props.col}`}
        className={`node ${extraclassName}`}
    />
}

export default Node;
